CREATE OR REPLACE TABLE `demo`.`users` (id INT NOT NULL , account_id INT, first_name STRING NOT NULL, last_name STRING NOT NULL, email STRING NOT NULL, gender STRING, ip_address STRING, avatar STRING, language STRING, deactivated BOOLEAN, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`purchases` (id INT NOT NULL , user_id INT NOT NULL, item STRING NOT NULL, category STRING NOT NULL, price DECIMAL, state STRING, created_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`plans` (id INT NOT NULL , name STRING NOT NULL, seats INT NOT NULL, monthly_rate INT NOT NULL);
CREATE OR REPLACE TABLE `demo`.`accounts` (id INT NOT NULL , name STRING NOT NULL, domain STRING NOT NULL, plan_id INT, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`payments` (id INT NOT NULL , account_id INT NOT NULL, amount DECIMAL, state STRING, created_at TIMESTAMP NOT NULL);
